    "biography": "From Wikipedia, the free encyclopedia.\n\nSam Parsonson made his television debut at the age of 17 on the Channel Seven Australian drama, headLand. Sam went on to appear in the critically acclaimed Australian drama series, Love My Way, for 2 seasons, alongside some of Australia's finest actors. His performance in the role of Dylan earned him a nomination for a Logie Award for Most Outstanding Young Talent in 2007. His other television credits include All Saints (TV series) and children's television series, Double Trouble (Australian TV series).\n\nSam has also accrued a list of theatre credits from a young age, including Summer Rain, Shakespeare Unleashed and Duologue from Titus and Andronicus for the Shakespeare Festival.\n\nIn 2008, Sam completed filming Steven Spielberg's US mini-series The Pacific (miniseries). The 10-part mini-series from the creators of Band of Brothers (TV miniseries) tells the intertwined stories of three Marines during America's battle with the Japanese in the Pacific during World War II.\n\nSam also stars in the Australian 2009 horror/thriller film Coffin Rock (film), starring as Evan, alongside actors such as Lisa Chappell and Robert Taylor (Australian actor).\n\nDescription above from the Wikipedia article Sam Parsonson, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
