    "biography": "Glen Thomas Powell Jr. is an American actor, writer, and producer. Powell was born and raised in Austin, Texas by Glen Sr. and Cyndy Powell. He has one older sister, Lauren Powell, who lives in Houston, Texas. His younger sister, Leslie Powell, is a singer. Before moving to Los Angeles, Glen became an active member of the Sigma Phi Epsilon Fraternity and attended The University of Texas at Austin, majoring in Radio, Television and Film. Powell began performing in professional theatre with roles in The Music Man, Oliver, O. Henry, and The Sound of Music. He also was part of the award winning performance troupe, the \"Broadway Texas Players\" from 1999–2003. He has starred in television shows such as Into the West, Jack & Bobby, CSI: Miami, Without a Trace, along with feature films The Great Debaters, The Hottest State, Fast Food Nation, Jumping Off Bridges, The Safe Side, The Wendell Baker Story, and Spy Kids 3-D: Game Over. In 2007, before his first year of college, Glen landed a role in The Great Debaters, directed by and starring Denzel Washington. Since moving to Los Angeles, he has starred in television shows such as: Into the West, Jack & Bobby, CSI: Miami, Without a Trace, Rizzoli & Isles and The Lying Game along with feature films including: The Hottest State, Fast Food Nation, Jumping Off Bridges, The Safe Side, The Wendell Baker Story and The Dark Knight Rises. Most recently, he filmed the independent feature Stuck in Love.[2][3] In 2013, Powell was cast in a role in The Expendables 3.",
