    "biography": "From Wikipedia, the free encyclopedia\n\nAnnalise Basso (born December 2nd, 1998) is an American film and television actress and model. Her older siblings, Alexandria and Gabriel Basso are also actors.\n\nLife and career\n\nAnnalise was born into the Basso acting family. She is the youngest child of Marcie Basso and has an older brother and sister; Gabriel and Alexandria. Most of her initial roles have been on television commercials or small one time roles on different shows. Her first role that caught the attention of people was her role as Eden Hamby on True Blood. In 2009, she played a main role in the TV movie Love Takes Wing from the Love Comes Softly series. When she was 10, she took part in the Are You Smarter Than a 5th Grader? where she played one of the students. More recently she has had major roles in episodes of New Girl and Nikita. Basso's first lead role in a feature film is in D.J. Caruso's Standing Up, a coming of age flick based on a book by Brock Cole called The Goats, which debuted at the 2012 Cannes Film Festival. The story centers on two children, played by Basso and Chandler Canterbury, who are stripped naked and left stranded together on an island as part of a summercamp prank.",
