    "biography": "John Gavin Malkovich  is an American actor, producer, director, and fashion designer. Over the last 30 years of his career, Malkovich has appeared in more than 70 motion pictures. For his roles in Places in the Heart and In the Line of Fire, he received Academy Award nominations. He has also appeared in well-received films such as Empire of the Sun, The Killing Fields, Dangerous Liaisons, Of Mice and Men, Being John Malkovich, Burn After Reading, RED, and Warm Bodies, as well as producing numerous films, including Juno and The Perks of Being a Wallflower. Malkovich attended exclusively Illinois schools throughout his childhood and into adulthood, building a community of like-minded performers such as Joan Allen, Gary Sinise and Glenne Headly, all of whom co-founded the Steppenwolf Theatre Company in 1976.  After appearing in numerous stage productions, Malkovich began acting in feature films in the late 1970s, garnering critical acclaim for his numerous dramatic and comedic roles in films such as Dangerous Liasions, Of Mice and Men, Being John Malkovich, and Burn After Reading.   In keeping with his renaissance-man image, he created his own fashion company, Mrs. Mudd, in 2002.  Malkovich continues to act, direct and produce numerous movies per year, and is considered one of the most influential voices in modern cinema.  ",
