    "biography": "Arthur Christopher Orme Plummer CC (born December 13, 1929) is a Canadian theatre, film and television actor. He made his film debut in 1958's Stage Struck, and notable film performances include The Night of the Generals, The Return of the Pink Panther, Star Trek VI: The Undiscovered Country, The Man Who Would Be King, and The Insider. In a career that spans seven decades and includes substantial roles in each of the dramatic arts, Plummer is probably best known to film audiences as the autocratic widower Captain Georg Johannes von Trapp in the hit 1965 musical film The Sound of Music alongside Julie Andrews.[1] Plummer has also ventured into various television projects, including the legendary miniseries The Thorn Birds.\n\nIn the 21st century his film roles include The Insider as Mike Wallace, Inside Man with Denzel Washington, the Disney–Pixar 2009 film Up as Charles Muntz, the Shane Acker production 9 as '1', The Last Station as Leo Tolstoy, The Imaginarium of Doctor Parnassus as Doctor Parnassus, The Girl with the Dragon Tattoo as Henrik Vanger, and Beginners as Hal.\n\nPlummer has won numerous awards and accolades for his work, including an Academy Award, two Emmy Awards, two Tony Awards, a Golden Globe Award, a SAG Award, and a BAFTA Award. With his win at the age of 82 in 2012 for Beginners, Plummer is the oldest actor and person ever to win an Academy Award.",
