    "biography": "Nel 1999 si diploma alla scuola del Piccolo Teatro di Milano, diretta da Giorgio Strehler e poi da Luca Ronconi. Dopo alcuni anni di teatro, lavorando anche con registi come Elio De Capitani eMassimo Castri, nel 2004 debutta nel cinema con Dopo mezzanotte, per la regia diDavide Ferrario, e nel 2005 è protagonista del film L'uomo perfetto di Luca Lucini. Recita in piccoli ruoli anche ne La bestia nel cuore, film di Cristina Comencini candidato all'Oscar, e in N (Io e Napoleone) (2006) di Paolo Virzì. Si è fatta conoscere presso il grande pubblico grazie alla sua partecipazione alla serie televisiva di Canale 5 Distretto di Polizia, interpretando nelle stagioni 6, 7 e 8 (2006-2008) il ruolo dell'ispettore Irene Valli. Tra il 2008 e il 2011 appare su Rai Uno nella serie televisiva Tutti pazzi per amore, dove interpreta il ruolo di Maya. Nel 2009torna sul grande schermo con tre film: Io, Don Giovanni, Questione di cuore e Generazione 1000 euro. Nel 2011 appare nel video di Max Pezzali Il mio secondo tempo, presentato al 61º Festival di SanRemo, ed è nel cast di Noi credevamo, regia di Mario Martone, presentato nello stesso anno alla mostra del cinema di Venezia e vincitore del Nastro d'argento come film dell'anno e di 7 David di Donatello, tra cui \"Miglior film\".",
