    "biography": "From Wikipedia, the free encyclopedia.\n\nEdward John \"Eddie\" Izzard (born 7 February 1962) is an English stand-up comedian and actor. His comedy style takes the form of rambling, whimsical monologue and self-referential pantomime.\n\nIzzard's works include stand-up sets Unrepeatable, Definite Article, Glorious, Dress to Kill, Circle, Sexie and Stripped. He had a starring role in the television series The Riches as Wayne Malloy and has appeared in many motion pictures such as Ocean's Twelve, Ocean's Thirteen, Mystery Men, The Cat's Meow, Across the Universe, and Valkyrie.\n\nHe has cited his main comedy role model as Monty Python, and John Cleese once referred to him as the \"Lost Python\". In 2009, he completed 43 marathons in 51 days for Sport Relief in spite of having no prior history of long distance running.\n\nHe is also known for his transvestism.s.\n\nDescription above from the Wikipedia article Eddie Izzard, licensed under CC-BY-SA, full list of contributors on Wikipedia.",
